INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (2834, "ペコリーヌとの出会い", 91002, "フリーマーケット会場", "青空の下で謁見", 8, 0, 20063115, 10118, 2, 5118061, "フリーマーケットを訪れたジータが出会ったのは\n城をこっそり抜け出していたペコリーヌだった。", 1, 7, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (2835, "マホとの出会い", 91002, "フリーマーケット会場", "未来の騎空団\nマスコット？", 8, 0, 20063115, 10118, 2, 5118062, "ジータたちがフリーマーケットを巡っていると\n露店を出していたマホに声をかけられる。", 1, 7, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (2837, "アキノとの出会い", 91002, "ランドソル市街地", "お嬢さまからの\n緊急依頼", 8, 0, 20063115, 10118, 2, 5118063, "ジータが騎空団への依頼を確認していると、\n高笑いをしながらアキノが現れる。", 1, 7, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4108402, "ジュンとの出会い", 91002, "フリーマーケット会場", "黄金色の悩みごと", 8, 0, 20063115, 10118, 2, 5118064, "ジータたちは、フリーマーケット会場で\n少し困った様子のジュンを見かける。", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4107402, "カオリとの出会い", 91002, "フリーマーケット会場", "白熱！　格闘大会！", 8, 0, 20063115, 10118, 2, 5118065, "フリーマーケットの隅で開かれる格闘大会──\nそこにはカオリもいて……？", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (9000227, "ニノンとの出会い", 91002, "オーエド町", "祭り太鼓はオーエドの華", 8, 1, 20063115, 10118, 2, 5118066, "太鼓祭を控えるオーエド町──\nジータは、困った様子のニノンと出会う。", 1, 16, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (2101181, "スズナとの出会い", 91002, "フリーマーケット会場", "人気者は遅れて\nやってくる", 8, 0, 20063115, 10118, 3, 5118067, "ビカラはイベントに出演中のスズナを見かける。\nしかし、スズナはどこか困っているようで……？", 1, 19, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4109402, "ナナカとの出会い", 91002, "ランドソル市街地", "巫女・ミーツ・魔法少女", 8, 0, 20063115, 10118, 3, 5118068, "ビカラたちが街を散策していると、通りかかった\nナナカが興奮した様子で近づいてきて……？", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4305402, "キャル＆コッコロとの出会い", 91002, "フリーマーケット会場", "ネズ耳は二度なくなる", 8, 0, 20063115, 10118, 3, 5118069, "ネズ耳をなくしてしまい絶望するビカラ。同じ頃\nキャルとコッコロは落とし物を拾っており……", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4101402, "ユカリとの出会い", 91002, "ランドソル市街地", "この出会いにカンパイ！", 8, 0, 20063115, 10118, 3, 5118070, "街外れでひと休みをしていたビカラたちは、\nすっかりゴキゲンな様子のユカリと出会う。", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (4106402, "アオイとの出会い", 91002, "ランドソル市街地", "陰陽アンサンブル", 8, 0, 20063115, 10118, 3, 5118071, "ビカラは、人混みに怯えるアオイを心配し、\n陽気に声をかけるも……", 1, 18, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (2836, "シノブとの出会い", 91002, "フリーマーケット会場", "運試し十番勝負！", 8, 1, 20063115, 10118, 3, 5118072, "ビカラがフリーマーケット会場を歩いていると\n占いをしていたシノブに声をかけられる。", 1, 7, 40);
INSERT INTO `v1_4f9c37b60b5155a8a6190a22966f0548614ed6755c4240f2a807283673e7b115` VALUES (0, "オープニング", 0, 0, "彼女たちの新たな日常", 0, 0, 20063115, 10118, 1, 5118600, 0, 0, 0, 0);
